import React from 'react'
import todo from "../img/img1.jpeg";

const Todo = () => {
  return (
    <div>
      <div className="main-div">
        <div className="child-div">
            <figure>
                <img src={todo} alt="todologo" />
            </figure>
        </div>
      </div>
    </div>
  )
}

export default Todo
